import React from "react";
import "./css/style.css"
const Temapp = () =>{
    return(
        <>
            <div className="box">
                <div className="inputData">
                    <input 
                    type="search" 
                    className="inputField" />
                </div>

            </div>
        </>
    )
}

export default Temapp;
